import { useState } from "react"

const HomePage = ()=>{

    const [loadAnimation, setLoadAnimation] = useState(false)
    const [games, setgames] = useState(["Minecraft", "ARK", "Terraria", "Unturned", "Rust"])

    setTimeout(()=>{
        setLoadAnimation(true)
    }, 50)

    const sleep = (milliseconds) => {
        return new Promise(resolve => setTimeout(resolve, milliseconds))
    }


    const changeGame = async ()=>{
        for(let game of games){
            await sleep(1000)
            console.log(game)
            console.log(games.indexOf(game))
        }
    }

    changeGame()

    return(
        <>
            <div className="homeMainContainer">
                <div className="innerContainer">
                    <span className={loadAnimation? "homeMainSpan":"homeMainSpanAway"}>Get your <span className="homeChangeGameSpan">Minecraft</span> server from U1Servers</span>
                </div>
            </div>
        </>
    )
}

export default HomePage
